import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import ParticlesBg from 'particles-bg';

class App extends Component {
  constructor() {
    super()
  }

  render() {
    return (
      <div className="App">
        <ParticlesBg type="cobweb" num={100} bg={true} />
        <h1>Hello There</h1>
      </div>
    );
  }
}

export default App;
